import{_ as a,a as e,b as r,c as t,d as s,e as o,f as l,g as i}from"./chunks/correct_mission.Dgt9IZWn.js";import{_ as p}from"./chunks/final_side.DW-ghjQN.js";import{_ as m,c,o as d,ab as n,m as h}from"./chunks/framework.CUflZczI.js";const N=JSON.parse('{"title":"Traxxas Stampede VXL","description":"","frontmatter":{},"headers":[],"relativePath":"ko/frames_rover/traxxas_stampede.md","filePath":"ko/frames_rover/traxxas_stampede.md"}'),_={name:"ko/frames_rover/traxxas_stampede.md"},x=n('<h1 id="traxxas-stampede-vxl" tabindex="-1">Traxxas Stampede VXL <a class="header-anchor" href="#traxxas-stampede-vxl" aria-label="Permalink to &quot;Traxxas Stampede VXL&quot;">​</a></h1><p>이 차량은 Pixhawk가 바퀴가 달린 플랫폼에 어떻게 사용될 수 있는지 이해하기 위해 선택되었습니다. 우리는 Traxxas 차량이 매우 인기 있고 RC 커뮤니티에서 매우 강력한 브랜드이기 때문에 사용하기로 선택하였습니다. 이 아이디어는 자동 조종 장치로 바퀴 달린 UGV를 쉽게 제어 할 수있는 플랫폼을 개발하는 것이었습니다.</p><p><img src="'+a+'" alt="Traxxas Stampede VXL"></p><h2 id="부품-목록" tabindex="-1">부품 목록 <a class="header-anchor" href="#부품-목록" aria-label="Permalink to &quot;부품 목록&quot;">​</a></h2><ul><li><a href="https://traxxas.com/products/models/electric/stampede-vxl-tsm" target="_blank" rel="noreferrer">Traxxas Stampede</a>의 부품들은 상단 플라스틱 덮개를 제외하고 모두 사용됩니다.</li><li><a href="./../flight_controller/pixhawk_mini.html">Pixhawk Mini (단종)</a><ul><li>3DR 10S 전원 모듈</li><li>3DR 433MHz Telemetry Module (EU)</li></ul></li><li><a href="http://www.spektrumrc.com/Products/Default.aspx?ProdId=SPM1000" target="_blank" rel="noreferrer">Spektrum Dxe 컨트롤러</a> 또는 기타 PX4 호환 리모컨</li><li><a href="http://www.spektrumrc.com/Products/Default.aspx?ProdID=SPM4648" target="_blank" rel="noreferrer">Spektrum 쿼드 레이스 직렬 수신기 w/Diversity</a></li><li><a href="./../sensor/px4flow.html">PX4Flow</a> (Deprecated)</li></ul><h2 id="조립" tabindex="-1">조립 <a class="header-anchor" href="#조립" aria-label="Permalink to &quot;조립&quot;">​</a></h2><p>부품들을 나무판위 부착하여 조립합니다. Pixhawk 및 Flow 모듈의 경우에는 좋은 진동 방진재를 사용하는 것이 좋습니다.</p><p><img src="'+e+'" alt="스탬피드 섀시"></p><p><img src="'+r+'" alt="나무 패널 상단"></p><p><img src="'+t+'" alt="나무 패널 하단"></p><p><img src="'+s+'" alt="Traxxas Stampede 조립 완성"></p><p><img src="'+p+'" alt="최종 조립 측면도"></p><p><img src="'+o+'" alt="목재 패널 고정 장치"></p><p>로버와 함께 제공된 클립을 사용하여 상부 플레이트를 부착하였습니다. 두 개의 지지대가 3D 인쇄되었습니다. CAD 파일은 <a href="https://github.com/PX4/px4_user_guide/raw/master/assets/airframes/rover/traxxas_stampede_vxl/plane_holders.zip" target="_blank" rel="noreferrer">여기</a>에서 제공됩니다.</p><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>훈련 모드에서 ESC를 설정하는 것을 <strong>적극 권장</strong>하며 (Traxxas Stampede 매뉴얼 참조) 전력을 50 %로 줄입니다.</p></div><h2 id="출력-연결" tabindex="-1">출력 연결 <a class="header-anchor" href="#출력-연결" aria-label="Permalink to &quot;출력 연결&quot;">​</a></h2><table><thead><tr><th>PWM 출력</th><th>액추에이터</th></tr></thead><tbody><tr><td>MAIN2</td><td>조향 서보</td></tr><tr><td>MAIN4</td><td>Throttle (ESC input)</td></tr></tbody></table><div class="info custom-block"><p class="custom-block-title">As documented in the Airframe Reference: <a href="./../airframes/airframe_reference.html#rover_rover_generic_ground_vehicle_(ackermann)">Generic ground vehicle (Ackermann)</a>.</p></div><h2 id="설정" tabindex="-1">설정 <a class="header-anchor" href="#설정" aria-label="Permalink to &quot;설정&quot;">​</a></h2><p>로버는 다른 기체와 같은 방법으로 <em>QGroundControl</em>을 사용하여 설정합니다.</p><p>중요한 로버 설정은 올바른 프레임을 설정하는 것입니다.</p><ol><li><em>QGroundControl</em>의 <a href="./../config/README.html">기본 설정</a> 섹션으로 전환합니다.</li><li><a href="./../config/airframe.html">Airframe</a> 탭을 선택합니다.</li><li>목록을 아래로 스크롤하여 <strong>Rover</strong> 아이콘을 찾습니다.</li><li>드롭다운 목록에서 <strong>Traxxas stampede vxl 2wd</strong>를 선택합니다.</li></ol><p><img src="'+l+'" alt="기체 선택"></p><h2 id="사용법" tabindex="-1">사용법 <a class="header-anchor" href="#사용법" aria-label="Permalink to &quot;사용법&quot;">​</a></h2><p>현재 PX4는 RC 리모컨이 연결된 경우 <a href="./../flight_modes/mission.html">MISSION</a> 과 MANUAL 모드만을 지원합니다. 미션 모드를 사용하려면 먼저 QGC로 차량에 새 미션을 업로드 하세요. 그런 다음 <code>MISSION</code>을 먼저 선택한 다음에 시동을 거십시오.</p><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>일반 웨이 포인트로 만 구성된 미션을 수행하는 것이 매우 중요하며 (예 : 이륙 웨이포인트 없음 등) 올바른 실행을 위해 <strong>모든</strong> 웨이 포인트의 높이를 0으로 설정하여야 합니다. 그렇게 하지 않으면, 로버가 웨이 포인트 주변을 계속 회전하게 됩니다.</p></div><p>올바른 임무 설정은 다음과 같습니다.</p><p><img src="'+i+'" alt="미션"></p><h2 id="비디오" tabindex="-1">비디오 <a class="header-anchor" href="#비디오" aria-label="Permalink to &quot;비디오&quot;">​</a></h2>',29),u=h("iframe",{width:"740",height:"416",src:"https://www.youtube.com/embed/N3HvSKS3nCw",frameborder:"0",allow:"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture",allowfullscreen:""},null,-1),f=[x,u];function g(b,k,w,P,S,v){return d(),c("div",null,f)}const D=m(_,[["render",g]]);export{N as __pageData,D as default};
